import React from 'react'
import { StyleSheet, Text, View, Image, TouchableOpacity } from 'react-native'
import { Input, Icon } from 'react-native-elements';

const RegisterScreen1 = () => {
    return (
        <View style={styles.mainContainer}>
            <View style={styles.navigationContainer}>
                <View style={styles.navigationRow}>
                    <Icon
                        name='arrow-back'
                        type='material'
                        color='#000'
                        onPress={() => console.log('back')} />
                    <TouchableOpacity onPress={()=> console.log('next')}><Text>Continue</Text></TouchableOpacity>
                </View>
            </View>
            <View style={styles.imageContainer}>
                <Image style={styles.image} source={require('../../assets/email_icon.png')} />
            </View>
            <View style={styles.headerContainer}>
                <Text style={styles.headerText1}>What's your email?</Text>
                <Text style={styles.headerText2}>We'll check if you have an account</Text>
            </View>
            <View style={styles.inputContainer}>
                <Input
                    label='Email'
                    placeholder='email@address.com'
                    inputContainerStyle={{ borderColor: 'purple', borderWidth: 2, borderBottomWidth: 2, borderRadius: 10 }}
                    containerStyle={{ width: '90%' }}
                // errorMessage='invalid email'
                />
            </View>
        </View>
    )
}

export default RegisterScreen1

const styles = StyleSheet.create({
    mainContainer: {
        // backgroundColor: 'yellow',
        flex: 1
    },
    navigationContainer: {
        flex: 0.1,
        // backgroundColor: 'red',
        alignItems: 'center',
        justifyContent: 'flex-end'
    },
    navigationRow: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        width: '90%'
    },
    imageContainer: {
        // backgroundColor: 'purple',
        flex: 0.15,
        paddingLeft: '10%'
    },
    image:{
        // backgroundColor: 'yellow',
        flex: 1,
        width: '30%',
        resizeMode: 'contain'
    },
    headerContainer: {
        // backgroundColor: 'pink',
        flex: 0.08,
        justifyContent: 'center'
    },
    headerText1: {
        fontSize: 25,
        fontWeight: '700',
        color: 'rgba(0,0,0,0.7)',
        paddingLeft: '5%'
    },
    headerText2: {
        fontSize: 15,
        fontWeight: '300',
        color: 'rgba(0,0,0,0.7)',
        paddingLeft: '6%'
    },
    inputContainer: {
        backgroundColor: 'green',
        flex: 0.4,
        alignItems: 'center',
        paddingTop: '7%'
    },
})
